import React from "react";
import styles from "./NavBar.module.css";
import styled from "styled-components";

export default function NavBar() {
  const H2 = styled.h2`
    color: #fff;
  `;
  return (
    <div className={styles.container}>
      <H2>Booking Website</H2>
    </div>
  );
}
